	var setSubscriptionModalBox = function(){
		
		/* If jQuery is not available */
		if (typeof jQuery === 'undefined' || screenWidth < 768) {
			return false;
		}
		/* If jQuery is not available END */
		
		var isLeftRightModalEnable = false;
		var isWindowOutModalEnable = false;
		var saveSubscriberCookieTime = 30; /* In Minutes: 14400 - 10 Days */
		var closeSubscriberBoxCookieTime = 5; /* In Minutes: 15 Minutes */
		var modal_theme = 'blue';
		/* modal_theme: blue, black, pink, red, green, brown, skyblue, purple, yellow, lightblue, light-sea-green, orange */
		
		var cookiePrefix = product_item_key;
		
		var modalThemeOptions = ['blue','black','pink','red','green','brown','skyblue','purple','yellow','lightblue','light-sea-green','orange'];
		if(typeof parameters['mbt'] !== 'undefined' && parameters['mbt'] != '' && modalThemeOptions.includes(parameters['mbt'])){
			modal_theme = parameters['mbt'];
		}
		
		
		var modalBoxCSS  = getModalCSS();
		var modalBoxHTML = getModalHTML(modal_theme);
		
		jQuery('body').append(modalBoxHTML+modalBoxCSS);
		
		
		/* Get the modal */ 
        var modal = document.getElementById("DZSubscriptionModal");
		
		jQuery(document).on('submit','.DZW3-Subscribe-Form',function(e){
			e.preventDefault();
			
			var formSelector = jQuery(this);
			var data = [];
			
			var dzEmail = formSelector.find('[name="dzEmail"]').val();
			var dzName  = formSelector.find('[name="dzName"]').val();
			
			var id='c905f0cf1b'; /* Winkit Website Contacts */
			var u = '05051835e9cfda57f103c2b67';
			
			if(dzEmail != '' && dzEmail != undefined){
				data.push({ name: 'MERGE0', value: dzEmail });
			}
			
			if(dzName != '' && dzName != undefined){
				data.push({ name: 'MERGE1', value: dzName });
			}
			
			if(data.length == 0){
				jQuery('.DZ-Form-Message-Box').css('color','red').text('Please fill fields.');
				return false;
			}
			
			
			formSelector.find('[type="submit"]').addClass('disabled');
			formSelector.find('.dzsm-comment-form-email').addClass('dz-ajax-overlay');
			
			jQuery.ajax({
				type : 'post',
				url : 'https://w3itexperts.us16.list-manage.com/subscribe/post-json?u='+u+'&id='+id+'&c=?',
				data : data,
				cache: false,
				dataType: 'jsonp',
				contentType: 'text/javascript',
				crossDomain:true,
				error: function( jqXHR, textStatus){
					console.log('err'); 
					console.log(jqXHR); 
					console.log(textStatus); 
					alert("Could not connect to the registration server. Please try again later."); 
					
					formSelector.find('[type="submit"]').removeClass('disabled');
					formSelector.find('.dzsm-comment-form-email').removeClass('dz-ajax-overlay');
				},
				success: function(response) {
					if(response.result == 'success'){
						jQuery('.DZ-Form-Message-Box').css('color','green').text(response.msg);
						setCookie(cookiePrefix+'_saveSubscriber','Yes',saveSubscriberCookieTime);
						
						setTimeout(function(){
							modal.style.display = "none";	
						}, 1000);
						
					}else{
						jQuery('.DZ-Form-Message-Box').css('color','red').text(response.msg);
					}
					formSelector.find('[type="submit"]').removeClass('disabled');
					formSelector.find('.dzsm-comment-form-email').removeClass('dz-ajax-overlay');
				}
			}) 
		});
		
		setTimeout(function(){
			
			var ssCookie = getCookie(cookiePrefix+'_saveSubscriber');
			var hmCookie = getCookie(cookiePrefix+'_hidemodal');
		
			if(hmCookie != 'Yes' && ssCookie != 'Yes'){
				modal.style.display = "block";
			}
		
		}, 5000);
		
		/* Get the <span> element that closes the modal */
        var span = document.getElementsByClassName("dz-subscription-modal-close")[0];
		
        /* When the user clicks on <span> (x), close the modal */
        span.onclick = function () {
            modal.style.display = "none";
			setCookie(cookiePrefix+'_hidemodal','Yes',closeSubscriberBoxCookieTime);
        }
		
		if(isWindowOutModalEnable){
			document.addEventListener("mouseout", function(evt){
				
				if (evt.toElement == null && evt.relatedTarget == null) {
					if (evt.pageX < 1100) {
						document.getElementById("DZEventName").innerHTML = 'onmouseout';
						modal.style.display = "block";
					}
				}
			});
		}
		
		
		if(isLeftRightModalEnable){
			var isWindowBottom = 0; 
			document.addEventListener("mousemove", function(evt){
				
				isWindowBottom = (evt.clientY > windowHeightMinus200) ? true : false;

				if (evt.pageX < 100  && isWindowBottom  ) {
					document.getElementById("DZEventName").innerHTML = 'leftbottom';
					modal.style.display = "block";
				}else if (isWindowBottom && evt.pageX > windowWidthMinus200) {
					document.getElementById("DZEventName").innerHTML = 'rightbottom';
					modal.style.display = "block";
				}
			});
		}
		
	}
	
